import React, { Component } from 'react';
import { Link } from '@reach/router';

class Navigation extends Component {
  render() {
    return (
      <div>
        <nav>
          <Link to="/hottest">Hottest</Link>
          <Link to="/topics">Topics</Link>
          <Link to="/users">Users</Link>
        </nav>
      </div>
    );
  }
}

export default Navigation;
